//imports
import { useState, useEffect } from "react";
import './App.scss';

//exports
export default function App() {
	const [backendData, setBackendData] = useState([{}]);

	useEffect(() => {
		fetch("/api").then(
			response => response.json()
		).then(
			data => {
				setBackendData(data)
			}
		)
	}, []);

	return (
		<div className="App">
			{
				(typeof backendData.item === "undefined") ?
					<p>Loading</p>
				:
					backendData.items.map((item, key) => {
						return (
							<p key={ key }>{ item }</p>
						)
					})
			}
		</div>
	);
}
